window.bookSummaryJSON = "<p><b>Vengeance made him a monster. Love will make him my mate.</b><br> <br> Deknol has sold his soul to The Deceiver. I can see it in the powers that he now wields. Far stronger than any magic present on Protheka. <b>It excites me.</b><br> <br> Because he will use his power to rescue me. To protect me. To pleasure me. The value of my life on Protheka is less than worthless. But when I stand next to Deknol, whose godlike powers crackle the air around him, I am a queen.<br> <br> <b>His queen.</b><br> <br> With all of our enemies seeking to tear us down, one question keeps nagging in my mind. With all of this power, Deknol has a body that can fight, a mind that can do magic . . . <br> <br> <b>But does he still have a heart that can love?</b><br> <br> Contains mature themes.</p>"; 
